import React from 'react';
import Frame71a from './Frame71a';

const Frame71 = () => {
  return (
    <div
      style={{
        width: '775px',
        minHeight: '606px',
        display: 'flex',
        flexDirection: 'row',
        gap: '18px',
        alignItems: 'flex-start',
      }}
    >
      <div style={{ paddingTop: '24px' }}>
        <img
          src="/mOCKUP.png"
          alt="Mockup"
          style={{ width: '386.58px', height: '606px', objectFit: 'cover', borderRadius: '8px' }}
        />
      </div>
      <div style={{ paddingTop: '24px' }}>
        <Frame71a />
      </div>
    </div>
  );
};

export default Frame71;
